import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function List(props) {
  
    return (
    <div className="">
    {props.item.map((item, index)=>  
      <div key={index}>
        <img src={item.picture}>
        </img>
      </div>
     )}
    </div>
  );
}

export default List;
